import { useRouter } from 'next/router'
import NameForm from '../../components/NameForm'

const Dias = (props) => {
  const router = useRouter()
  const { name } = router.query

  return (
    <div>
      <NameForm nomeRecebido={name} />
    </div>
  )
}

export default Dias
